import React, { Fragment } from 'react'

const inputTodo = () => {
  return (
    <Fragment>
      <h1 className='text-center mt-5 text-4xl font-bold'>Pern Todo List</h1>
      <form>
        <input type="text" className='border-2 border-black block w-[300px] mx-auto mt-10 h-7'/>
        <button>Add</button>
      </form>
    </Fragment>
  )
}

export default inputTodo
